import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomeList from './components/HomeList';
import HomeDetails from './components/HomeDetails';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route
            path="/"
            element={<HomeList />}
          />
          <Route
            path="/:id"
            element={<HomeDetails />}
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;




